import styled from 'styled-components/native'

export const Container = styled.View`
  background-color: transparent;
  padding-top: 30;
  flex-direction: column;
  align-items: center;
`

export const Hand = styled.Image`
  width: 100px;
  height: 200px;
  margin-top: 0px;
`
